import PropTypes from 'prop-types';

const MyComponent = ({ name, favoriteNumber, children }) => {
  return null;
};

MyComponent.defaultProps = {
  name: 3,
};

MyComponent.propTypes = {
  name: PropTypes.number,
  children: PropTypes.string,
};

export default MyComponent;
